s-boost/labels/installer', 'name': 'installer', 'color': 'E6D378', 'default': False, 'description': 'Command line installer functionality'}, {'id': 2991543235, 'node_id': 'MDU6TGFiZWwyOTkxNTQzMjM1', 'url': 'https://api.github.com/repos/awslabs/aws-saas-boost/labels/analytics-module', 'name': 'analytics-module', 'color': 'C1AB81', 'default': False, 'description': 'Optional analytics and metrics module (distinct from the built-in dashboards in the admin web app)'}], 'state': 'closed', 'locked': False, 'assignee': {'login': 'PoeppingT', 'id': 4009272, 'node_id': 'MDQ6VXNlcjQwMDkyNzI=', 'avatar_url': 'https://avatars.githubusercontent.com/u/4009272?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/PoeppingT', 'html_url': 'https://github.com/PoeppingT', 'followers_url': 'https://api.github.com/users/PoeppingT/followers', 'following_url': 'https://api.github.com/users/PoeppingT/following{/other_user}', 'gists_url': 'https://api.github.com/users/PoeppingT/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/PoeppingT/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/PoeppingT/subscriptions', 'organizations_url': 'https://api.github.com/users/PoeppingT/orgs', 'repos_url': 'https://api.github.com/users/PoeppingT/repos', 'events_url': 'https://api.github.com/users/PoeppingT/events{/privacy}', 'received_events_url': 'https://api.github.com/users/PoeppingT/received_events', 'type': 'User', 'site_admin': False}, 'assignees': [{'login': 'PoeppingT', 'id': 4009272, 'node_id': 'MDQ6VXNlcjQwMDkyNzI=', 'avatar_url': 'https://avatars.githubusercontent.com/u/4009272?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/PoeppingT', 'html_url': 'https://github.com/PoeppingT', 'followers_url': 'https://api.github.com/users/PoeppingT/followers', 'following_url': 'https://api.github.com/users/PoeppingT/following{/other_user}', 'gists_url': 'https://api.github.com/users/PoeppingT/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/PoeppingT/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/PoeppingT/subscriptions', 'organizations_url': 'https://api.github.com/users/PoeppingT/orgs', 'repos_url': 'https://api.github.com/users/PoeppingT/repos', 'events_url': 'https://api.github.com/users/PoeppingT/events{/privacy}', 'received_events_url': 'https://api.github.com/users/PoeppingT/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 1, 'created_at': '2022-01-14T00:13:45Z', 'updated_at': '2022-01-25T18:08:47Z', 'closed_at': '2022-01-25T18:08:47Z', 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'When creating a SaaS Boost Environment using the install script `install.sh` the installer will create three different parameters:
```
"/saas-boost/" + this.envName + "/ACTIVE_DIRECTORY_PASSWORD",
"/saas-boost/" + this.envName + "/METRICS_ANALYTICS_DEPLOYED",
"/saas-boost/" + this.envName + "/REDSHIFT_MASTER_PASSWORD"
```
Those same three parameters are deleted when deleting a SaaS Boost Environment using the install script `install.sh`.

However, those parameters are deleted before deleting the related CloudFormation stacks, which will cause stack delete failures when trying to delete the SaaS Boost Environment. Subsequent attempts to delete the environment using the installer will fail because those SSM parameters no longer exist, forcing the user to delete the stacks and all related AWS resources through the AWS console or some other method: not a small task.

### Reproduction Steps

Create a new SaaS Boost Environment using the installer. Install SaaS Boost Metrics + Analytics as part of the installation process.
Once the installation is complete, attempt to delete the SaaS Boost environment. It will fail.
Trying to delete again will also fail, but this time because the SSM parameters are deleted.

### What did you expect to happen?

The installer should successfully delete the SaaS Boost environment.

### What actually happened?

The installer was unable to successfully delete the SaaS Boost environment.


### Environment

  - **AWS Region  :**us-west-2
  - **AWS SaaS Boost Version :**v1.1.2
  - **Workload OS  (Linux or Windows) :**(no workload)

### Other

#### First stack delete failure(s):
```
RedshiftCluster DELETE_FAILED Parameters: [ssm-secure:/saas-boost/ui/REDSHIFT_MASTER_PASSWORD] cannot be found.
MetricsStream DELETE_FAILED Parameters: [ssm-secure:/saas-boost/ui/REDSHIFT_MASTER_PASSWORD:1] cannot be found.
```

#### Second installer failure:
```
2022-01-13 13:46:54.385  ERROR SaaSBoostInstall - software.amazon.awssdk.services.ssm.model.ParameterNotFoundException: null (Service: Ssm, Status Code: 400, Request ID: 57f093c5-0619-4abe-8fbd-e12e0b9e495f, Extended Request ID: null)
	at software.amazon.awssdk.core.internal.http.CombinedResponseHandler.handleErrorResponse(CombinedResponseHandler.java:123)
...
	at software.amazon.awssdk.core.client.handler.SdkSyncClientHandler.execute(SdkSyncClientHandler.java:45)
	at software.amazon.awssdk.awscore.client.handler.AwsSyncClientHandler.execute(AwsSyncClientHandler.java:56)
	at software.amazon.awssdk.services.ssm.DefaultSsmClient.getParameter(DefaultSsmClient.java:8598)
	at software.amazon.awssdk.services.ssm.SsmClient.getParameter(SsmClient.java:14737)
	at com.amazon.aws.partners.saasfactory.saasboost.SaaSBoostInstall.getExistingSaaSBoostAnalyticsDeployed(SaaSBoostInstall.java:1339)
	at com.amazon.aws.partners.saasfactory.saasboost.SaaSBoostInstall.loadExistingSaaSBoostEnvironment(SaaSBoostInstall.java:1218)
	at com.amazon.aws.partners.saasfactory.saasboost.SaaSBoostInstall.start(SaaSBoostInstall.java:191)
	at com.amazon.aws.partners.saasfactory.saasboost.SaaSBoostInstall.main(SaaSBoostInstall.java:150)
```
Originating from this code:
